  false,\n\t\"url\": null,\n\t\"notes\": \"This plan provides a description of the
  trapping program proposed for the 1981-82 trapping season on the Mingo NWR. Items
  discussed include details of the trapping methods and procedures, areas on the refuge
  where trapping is permitted, target furbearer species, an environmental assessment
  of the program, the relationship of trapping to other refuge programs and objectives,
  and the benefits derived from trapping. This plan also serves as the medium for
  review and approval of the trapping program on the refuge.\",\n\t\"license_title\":
